import React from "react";
import { Container } from "@mui/material";
import { Logo } from "./styles";
import ComapnyLogo from "logo-social.png";
import "./App.css";

function App() {
  return (
    <Container sx={{ backgroundColor: "red" }} maxWidth="xl">
      <Logo src={ComapnyLogo} />
    </Container>
  );
}

export default App;
